subscription replace($input: SubscribeInput!) {
  subscribe(input: $input) {
    id
    ... on BasicMessage {
      data {
        __typename
        ... on FullFrameMessageData {
          __typename
          name
          timestamp
        }
        ... on DiffFrameMessageData {
          __typename
          name
          currentTimestamp
          previousTimestamp
        }
      }
      __typename
    }
    __typename
  }
}
